import React from "react";
//import CourseList from "../component/CourseList.jsx";
//import AccountInfo from "../component/AccountInfo.jsx";
import { BrowserRouter, Link, Route, Switch } from "react-router-dom";
function AccountInfo() {
  return (
    <ul>
      <li>Name</li>
      <li>Account Number</li>
      <li>Password</li>
    </ul>
  );
}

function CourseList() {
  return (
    <ul>
      <li>react</li>
      <li>java script</li>
      <li>redux</li>
    </ul>
  );
}

function Tutorial() {
  return (
    <div>
      intruduction of this app
      <p>
        you can login first, and put your courses, your questions and your
        answers here
      </p>
    </div>
  );
}

class HomepageGuide extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <ul>
        <li>
          <Link to="/">HomePage</Link>
        </li>
        <li>
          <Link to="/my_account">My Account</Link>
        </li>
        <li>
          <Link to="my_courses">My courses</Link>
        </li>
        <Switch>
          <Route exact path="/" Component={Home}></Route>
          <Route path="/my_account" Component={AccountInfo}></Route>
          <Route path="/my_courses" Component={CourseList}></Route>
        </Switch>
      </ul>
    );
  }
}

export default class Home extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <>
        <div>
          <header>Home Page</header>
        </div>
        <hr />
        <Tutorial />
        <BrowserRouter>
          <HomepageGuide />
        </BrowserRouter>
      </>
    );
  }
}
